import React, { useState } from "react";
import Icon from "react-native-vector-icons/AntDesign" 
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput } from "react-native";
import {  
    FirstView6,
    BigText5,
    SecondView6
} from "../componenets/fintech6Style"
import { PhotoView, Quantity, QtyText } from "../componenets/fintech4Style";
import { PhotoView1, Quantity1, QtyText1 } from "../componenets/fintech5Style";
export default function Fintech6({navigation}){
    return(
        <SafeAreaView style={styles.fintech6container}>
            <ScrollView>
                <FirstView6>
                <TouchableOpacity style={styles.back4} onPress={()=>navigation.navigate("Fintech1")}>
                   <Icon size={20} color="#C3AD60" name="back" style={styles.pad5}/> 
                    </TouchableOpacity>
                   <BigText5 style={styles.pad5}>Submitted Orders</BigText5>
                </FirstView6>
                <SecondView6>
                <PhotoView1>
                    <Quantity1><QtyText1>Qty: 1</QtyText1><Icon name="caretdown" size={6} color="#fff"/></Quantity1>
                    <TextInput style={styles.link} value="link"></TextInput>
                </PhotoView1>
                <PhotoView source={require('../../../../assets/pro.png')}>
                    <Quantity><QtyText>Qty: 1</QtyText><Icon name="caretdown" size={6} color="#fff"/></Quantity>
                </PhotoView>
                
                </SecondView6>
            </ScrollView>
        </SafeAreaView>
)};

const styles = StyleSheet.create({
    fintech6container: {
        backgroundColor: "#000",
        paddingTop: 25,
        flex: 1,
    },
    back4: {
        padding: 10,
    },
    pad5: {
        paddingLeft: 40,
    },
    link: {
        height: 64,
        width: 340,
        backgroundColor: "#4E4E4E",
        color:"#fff",
        borderBottomLeftRadius: 20,
        borderBottomRightRadius: 20,
        position: "absolute",
        left: 0,
        top: 156,
        paddingLeft: 25,
    }
})
